from langflow.custom import Component
from langflow.inputs import DataInput, MessageTextInput, DropdownInput, SecretStrInput
from langflow.template import Output
from langflow.schema import Data
from semantic_router import Route, RouteLayer
from semantic_router.encoders import CohereEncoder, OpenAIEncoder
import os

class SemanticRouterComponent(Component):
    display_name = "Semantic Router"
    description = "Routes input phrases based on semantic similarity to predefined routes."
    icon = "ğŸ”€"

    inputs = [
        DataInput(name="routes_data", display_name="Routes Data", info="Data defining the routes.", is_list=True),
        MessageTextInput(name="input_phrase", display_name="Input Phrase", info="Phrase to route."),
        DropdownInput(name="model_type", display_name="Model Type", options=["OpenAI", "Cohere"], info="Type of the encoder model."),
        SecretStrInput(name="openai_api_key", display_name="OpenAI API Key", info="API key for OpenAI encoder.", advanced=False),
        SecretStrInput(name="cohere_api_key", display_name="Cohere API Key", info="API key for Cohere encoder.", advanced=False),
    ]

    outputs = [
        Output(display_name="Routing Result", name="routing_result", method="route"),
    ]

    def __init__(self, **kwargs):
        super().__init__(**kwargs)
        self.encoder = None
        self.route_layer = None

    def build_routes(self, routes_data):
        routes = []
        for route_data in routes_data:
            try:
                route_name = route_data['data']['route_name']
                utterances = route_data['data']['utterances']
                route = Route(name=route_name, utterances=utterances)
                routes.append(route)
            except KeyError as e:
                raise ValueError(f"Missing required field: {e}")
        return routes

    def initialize_encoder(self, model_type, openai_api_key, cohere_api_key):
        if model_type == "OpenAI":
            os.environ["OPENAI_API_KEY"] = openai_api_key
            self.encoder = OpenAIEncoder()
        elif model_type == "Cohere":
            os.environ["COHERE_API_KEY"] = cohere_api_key
            self.encoder = CohereEncoder()
        else:
            raise ValueError(f"Unsupported encoder model: {model_type}")

    def route(self) -> Data:
        routes_data = self.routes_data  # Access routes_data directly
        input_phrase = self.input_phrase
        model_type = self.model_type
        openai_api_key = self.openai_api_key
        cohere_api_key = self.cohere_api_key

        # Initialize encoder and route layer if not already done
        if self.encoder is None:
            self.initialize_encoder(model_type, openai_api_key, cohere_api_key)
        if self.route_layer is None:
            routes = self.build_routes(routes_data)
            self.route_layer = RouteLayer(encoder=self.encoder, routes=routes)

        # Route the input phrase
        result = self.route_layer(input_phrase)

        if result:
            routing_result = {"route": result.name}
        else:
            routing_result = {"route": None}

        return Data(data=routing_result)

